// MessagesCard.js
import React from 'react';

const messagesData = [
  {
    id: 1,
    phoneNumber: "123-456-7890",
    message: "Hey, I would like to know more about your services.",
    date: "2024-09-25",
    time: "10:30 AM",
  },
  {
    id: 2,
    phoneNumber: "987-654-3210",
    message: "Can we schedule a call for next week?",
    date: "2024-09-24",
    time: "12:45 PM",
  },
  // Add more messages as needed
];

const MessagesCard = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">Messages</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {messagesData.map((msg) => (
          <div
            key={msg.id}
            className="bg-white p-4 rounded-lg shadow-md flex flex-col justify-between"
          >
            <div className="mb-4">
              <p className="text-gray-600 font-semibold">From: {msg.phoneNumber}</p>
              <p className="text-gray-800 mt-2">{msg.message}</p>
            </div>
            <div className="text-gray-500 text-sm">
              <p>Received: {msg.date}</p>
              <p>Time: {msg.time}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MessagesCard;
